import {Link} from 'react-router-dom';
import logo from '../assets/images/logo.jpg';

export function Navbar () {
    return (
      <nav className='relative container'>
        <div className='flex text-center space-x-6'>
          <img src={logo} alt="logo" className='w-28'/>
          <div className='hidden md:flex space-x-5 my-6'>
            <Link className='hover:underline active:bg-violet-700' to="/">Shop</Link>
            <Link className='hover:underline' to="/contact">Brands</Link>
            <Link className='hover:underline' to="/">Sale</Link>
            <Link className='hover:underline' to="/">Discover</Link>
            <Link className='hover:underline' to="/">Beauty Services</Link>
          </div>

        </div>
      </nav>
    );
}
